"use strict";let titleList=Object.keys(Object.assign(JSON.parse(localStorage.getItem("storage")),JSON.parse(localStorage.getItem("past"))));const search=document.getElementById("search"),titles=document.getElementById("titles");search.onkeyup=e=>{switch(e.keyCode){case 38:console.log("up");break;case 40:console.log("down");break;default:let t=e.target.value;if(t){titles.style.display="",titles.innerHTML="";for(let e in titleList)if(titleList[e].toLocaleLowerCase().includes(t.toLocaleLowerCase())){let t=document.createElement("li");t.innerHTML=titleList[e],t.classList.add("highlight"),t.setAttribute("id",(e+100).toString()),t.addEventListener("click",(function(){console.log(this.innerHTML)})),titles.append(t)}}else titles.style.display="none"}};
